import { Component, EventEmitter, Output } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

  @Output() sideNavToogle = new EventEmitter<boolean>();
  menustatus :boolean = false;

  constructor(private route:Router){}
  goToPage(pageName:string):void{
    this.route.navigate([`$(pageName)`])
  }
  ngOnInit():void{

  }
  SideNavToogle(){
    this.menustatus = !this.menustatus;
    this.sideNavToogle.emit(this.menustatus);
  }


}
<nav class="navbar navbar-expand-lg bg-primary">
    <div class="container-fluid">


      <div style="margin-right: 2%;margin-bottom: 0.5%;" (click)="SideNavToogle()">
        <i style="margin-right: 2%; color: aliceblue;" class="fa-solid fa-bars"></i>
      </div>



      <h4>
        <a style="color: aliceblue;" class="navbar-brand" href="#">Navbar</a>
      </h4>




      <div class="collapse navbar-collapse" id="navbarNav">
        <ul class="navbar-nav">
          <li class="nav-item">
            <h5>

              <a class="nav-link" style="color: aliceblue;" aria-current="page" href="#">Home</a>
            </h5>
          </li>
          <li class="nav-item">
            <h5>

              <a class="nav-link" style="color: aliceblue;" (click)="goToPage('Patient')" href="Patient/">Patient</a>
            </h5>
          </li>
          <li class="nav-item">
            <h5>
              <a class="nav-link" style="color: aliceblue;" href="#">Doctor</a>
            </h5>
          </li>

        </ul>
      </div>
    </div>


  </nav>
